Description:
Tommy highlights the career of songwriter Rod Temperton whose work includes "Thriller" and "Rock with You" by Michael Jackson, "Boogie Nights" by Heatwave, "Sweet Freedom" by Michael McDonald, and "Give Me The Night" by George Benson.

